import React, { useEffect, useState } from 'react';
import { ReactDOM } from 'react';

function Fetchtable() {
    const [rec, setRec] = useState([]);
    useEffect(() => {
        fetch('http://localhost:5050/api/call/userinfo')
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setRec(data);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);
    return (
        <table>
            <thead>
                <tr>
                    <th>Email</th>
                    <th>FirstName</th>
                    <th>LastName</th>
                    <th>Mobile</th>
                    <th>DOB</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
                {
                    rec.map((user, index) => {
                        const {email,firstname,lastname,mobile,dob}=user;
                        <tr key={index}>
                            <td>{email}</td>
                            <td>{user.firstname}</td>
                            <td>{user.lastname}</td>
                            <td>{user.mobile}</td>
                            <td>{user.dob}</td>
                            <td><button>Edit</button><button>Delete</button></td>
                        </tr>
                    })
                }
            </tbody>
        </table>
    )
}
export default Fetchtable;
